import React from 'react';

function SpotifyBlock() {
    
    return(
        <iframe 
            src="https://open.spotify.com/embed/playlist/0absvxmEjPk41K9F0tmJGx" 
            width="100%" 
            height="380" 
            frameborder="0" 
            allowtransparency="true" 
            allow="encrypted-media">
        </iframe>
    )
    
}

export default SpotifyBlock;
